import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import Hero from '../components/Hero';
import ProjectOverview from '../components/ProjectOverview';
import NearbyConnectivity from '../components/NearbyConnectivity';
import Amenities from '../components/Amenities';
import AboutUs from '../components/AboutUs';
import ConstructionUpdates from '../components/ConstructionUpdates';
import FAQ from '../components/FAQ';
import Footer from '../components/Footer';
import axios from '../axios';

const Home = () => {
    const [content, setContent] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchContent();
    }, []);

    const fetchContent = async () => {
        try {
            const response = await axios.get('/content');
            setContent(response.data);
            setLoading(false);
        } catch (error) {
            console.error('Error:', error);
            setLoading(false);
        }
    };

    if (loading) return <div>Loading...</div>;

    return (
        <div>
            <Navbar />
            <Hero content={content} />
            <ProjectOverview content={content} />
            <NearbyConnectivity content={content} />
            <Amenities content={content} />
            <AboutUs content={content} />
            <ConstructionUpdates content={content} />
            <FAQ content={content} />
            <Footer />
        </div>
    );
};

export default Home;
